import React, {Component} from 'react';
import './App.css';
import PowerPlantsData from './PowerPlantsData.js';
import Filters from './filters/Filters';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Power Plants Data!</h1>
        <PowerPlantsData />
        <Filters />
      </div>
    );
  }
}

export default App;
